                    <div className="flex flex-wrap justify-content-center align-items-center gap-2">
                        <label className="w-6rem">Username</label>
                        <InputText id="username" type="text" className="w-12rem" placeholder='Enter your name' {...inputName} />
                    </div>
                    <div className="flex flex-wrap justify-content-center align-items-center gap-2">
                        <label className="w-6rem">Password</label>
                        <InputText id="password" type="password" className="w-12rem" placeholder='Enter your roll number' {...inputPwd} />
                    </div>
                    <Button label="Login" icon="pi pi-user" className="w-10rem mx-auto" onClick={submitHandler}></Button>
                </div>
                
                
            </div>
        </div>
        </form>
     
       
     
    );
 

};



export default App;
